import React from 'react';
import {DeafaultSection} from './styles';

type Props = {
  children: React.ReactNode;
  HeaderText: String;
}
function Section({ children, HeaderText }: Props) {
    return (
      <DeafaultSection>
        if ({HeaderText.toString.length > 0}) {
          <h1>{HeaderText}</h1>          
        }
        {children}
      </DeafaultSection>
    );
};
  
export default Section;
